import React, { Component } from "react";
import './home.css';
import Logo from '../images/hulugram blueish 2.png';

class Home extends Component {
  render() {
    return (
      <React.Fragment>
      <div className="main_logo_wrapper">
      <a href="/" className="hulugram_main_logo">
        <img className="hulugram_main_logo" src={Logo} alt="Hulugram Logo"/>
       <div className="hulugram_main_logo_title_image"></div>
      </a>
     <p className="hulugram_main_logo_lead">a new era of messaging</p>
    </div>


    <hr style="margin-bottom:"/>
<div className="side_blog_wrap">
   <a href="/blog" class="side_blog_header">Recent News</a>
   <div className="side_blog_entries">
     <a href="/blog/scheduled-reminders-themes" class="side_blog_entry">
   <div classNam="side_blog_date">Sep 5</div>
   <div classNam="side_blog_title">Scheduled Messages, Reminders, Custom Cloud Themes and More Privacy</div>
 </a><a href="/blog/6-years" class="side_blog_entry">
   <div className="side_blog_date">Aug 15</div>
   <div className="side_blog_title">Celebrating 6 Years of Telegram</div>
 </a><a href="/blog/silent-messages-slow-mode" class="side_blog_entry">
   <div className="side_blog_date">Aug 9</div>
   <div className="side_blog_title">Silent Messages, Slow Mode, Admin Titles and More</div>
 </a>
   </div>
 </div>
    </React.Fragment>
    );
  }
}

export default Home;
